import React from 'react';

import useFetch from '../../utils/hooks/hook';

import './Home.css';

const Home = () => {
	const { data, loading, error } = useFetch('http://localhost:3000/user/12');
	console.log(
		'data : ',
		data,
		'\n=====================',
		'\nloading : ',
		loading,
		'\n=====================',
		'\nerror : ',
		error
	);
	return <div>Home</div>;
};

export default Home;
